import React from "react";
import {NavLink } from "react-router-dom";

function Navbar(){
    return(<div>
        <div className="header">
            <ul className="nav justify-content-center">
                <li className="nav-item">
                    <NavLink to="/" className="nav-link-white">Домашня сторінка</NavLink>
                </li>
            </ul>
        </div>
            <div className="linksNav">
                <NavLink to="revision" className="nav-link link-primary" activeClassName={'nav-link-active'}>Перегляд</NavLink>
                <NavLink to="additions" className="nav-link link-primary">Додати нову техніку</NavLink>
                <NavLink to="transfer" className="nav-link link-primary">Виписати наряд</NavLink>
            </div>
        </div>
        );
}
export default Navbar;
